memoryHistory = [('quiero valuar una oficina en la planicie de 25 metros', 'Hola, soy Valia Copilot, tu Asistente de Valoración de Inmuebles en Perú. Para poder ayudarte, necesito algunos detalles adicionales. ¿Podrías proporcionarme la dirección exacta de la oficina en la Planicie? Esto me ayudará a obtener una valoración más precisa. Si no tienes la dirección exacta, también puedo trabajar con la ciudad en la que se encuentra la oficina. Por ejemplo, Lima.'), ('se encuentra en la planicie, la molina', 'Gracias por proporcionar la ubicación de la oficina. A continuación, te muestro los datos que tengo hasta ahora:\n\n- Dirección: La Planicie, La Molina\n\nAhora necesito que me proporciones el tipo de inmueble. ¿Podrías decirme si la oficina es una casa, departamento, local comercial, local industrial, terreno u oficina?'), ('ya de dije que es una oficina', 'Gracias por la información adicional. A continuación, te muestro los datos actualizados:\n\n- Dirección: La Planicie, La Molina\n- Tipo de inmueble: Oficina\n\nAhora necesito que me indiques el tipo de operación. ¿Estás buscando vender o alquilar la oficina?'), ('Quiero darla en alquiler', 'Gracias por la información adicional. A continuación, te muestro los datos actualizados:\n\n- Dirección: La Planicie, La Molina\n- Tipo de inmueble: Oficina\n- Tipo de operación: Alquiler\n\nAhora necesito que me proporciones el área total de la oficina en metros cuadrados.'), ('ya te lo dije', 'Gracias por recordármelo. A continuación, te muestro los datos actualizados:\n\n- Dirección: La Planicie, La Molina\n- Tipo de inmueble: Oficina\n- Tipo de operación: Alquiler\n- Área total: [Área total proporcionada por el usuario]\n\nAhora necesito que me proporciones el área construida de la oficina en metros cuadrados.'), ('tiene 25 metros de area total y 25 de construida', 'Gracias por la información. A continuación, te muestro los datos actualizados:\n\n- Dirección: La Planicie, La Molina\n- Tipo de inmueble: Oficina\n- Tipo de operación: Alquiler\n- Área total: 25 m2\n- Área construida: 25 m2\n\nAhora necesito que me proporciones la antigüedad de la oficina en años.'), ('es bastante nueva, tendra unos 3 anos', 'Gracias por la información. A continuación, te muestro los datos actualizados:\n\n- Dirección: La Planicie, La Molina\n- Tipo de inmueble: Oficina\n- Tipo de operación: Alquiler\n- Área total: 25 m2\n- Área construida: 25 m2\n- Antigüedad: 3 años\n\nCOMPLETED')]